const handleSubmit = e => {
  console.log(e.target[0].value);
}
  return (
    <form onSubmit={handleSubmit}>
      <Row>
        <Input s={6} label="Snippet Name" />
        <Input s={2} offset={'s2'} type="number" label="User ID" />
        <Input type="textarea" label="HTML" s={12} />
        <Input type="textarea" label="CSS" s={12} />
      </Row>
      <Row>
        <Button s={2} offset={'s10'} waves='purple'>SignIn</Button>
      </Row>
    </form>
  )
}

export default CreateSnippet;
